  width: 100%;
  height: 100%;

  display: none;
  place-items: center;

  position: absolute;
  top: 0;
  left: 0;

  background: rgba(0, 0, 0, 0.8);

  &_container {
    width: 50%;
  }

  &_close {
    position: absolute;
    top: 2rem;
    right: 4rem;
    font-size: 6rem;
    font-weight: 100;

    cursor: pointer;
  }

  &_themes {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    grid-template-rows: 5rem;
    grid-gap: 1rem;

    margin-top: 1rem;

    &-color {
      width: 60%;
      height: 60%;
    }

    .pink {
      border-radius: 1rem;
      border: 2px solid #fffc31;
      background: transparent;
      cursor: pointer;

      transition: all 0.1s ease-in;

      &:hover {
        background: #fffc31;
      }
    }

    .orange {
      border-radius: 1rem;
      border: 2px solid #f99419;
      background: transparent;
